import { useState } from 'react';
import styled from 'styled-components';
import TransitionLayout from 'components/layout/TransitionLayout';
import EditorField from 'components/form/EditorField';
import { EditorState } from 'draft-js';

const BoardWriteWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-flow: row wrap;
`;

interface Props {}

const BoardWritePage = ({}: Props): JSX.Element => {
  const [editorState, setEditorState] = useState(EditorState.createEmpty());
  // const [datas, setDatas] = React.useState([]);
  // const [editorState, setEditorState] = React.useState(EditorState.createEmpty());
  // const [active, setActive] = React.useState(false);
  // const [targetId, setTargetId] = React.useState(0);

  return (
    <TransitionLayout>
      <BoardWriteWrapper>
        <h1>글쓰기</h1>
        <EditorField val={editorState} setVal={setEditorState} />
        <EditorField editMode={true} />
      </BoardWriteWrapper>
    </TransitionLayout>
  );
};

export default BoardWritePage;
